import EventDetailPage from "./EventDetail";

const DUMMY_EVENTS = [
  {
    id: "e1",
    title: "First Event",
  },
  {
    id: "e2",
    title: "Second Event",
  },
];

function EventsPage() {
  return (
    <>
      <h1>EventsPage</h1>
      <ul>
        {DUMMY_EVENTS.map((event) => (
          <li><EventDetailPage id={event.id} title={event.title}/></li>
        ))}
      </ul>
    </>
  );
}

export default EventsPage;
